-- ----------------------------
-- Table structure for `books`
-- ----------------------------
DROP TABLE IF EXISTS `books`;
CREATE TABLE `books` (
  `book_id` int(11) NOT NULL auto_increment COMMENT '图书编号',
  `bookname` varchar(50) NOT NULL COMMENT '书名',
  `bookwrite` varchar(50) NOT NULL COMMENT '作者',
  `booktype` int(11) NOT NULL COMMENT '图书类型',
  `publishdate` date default '2016-05-11' COMMENT '出版时间',
  `bookintroduce` varchar(1000) default '空' COMMENT '简介',
  `picture` varchar(255) default '封面.jpg',
  `price` float default NULL COMMENT '价格',
  `picture2` mediumblob COMMENT '封面',
  PRIMARY KEY  (`book_id`),
  KEY `PK_type` (`booktype`),
  CONSTRAINT `PK_type` FOREIGN KEY (`booktype`) REFERENCES `type` (`type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of books
