INSERT INTO books VALUES ('1', '完美世界', '辰东', '1', '2013-08-16', '一粒尘可填海，一根草斩尽日月星辰，弹指间天翻地覆。 群雄并起，万族林立，诸圣争霸，乱天动地；问苍茫大地，谁主沉浮？！！！ 一个少年从大荒中走出，一切从这里开始。', '001.jpg', '33', );
INSERT INTO books VALUES ('2', '遮天', '辰东', '1', '2013-05-21', '冰冷与黑暗并存的宇宙深处，九具庞大的龙尸拉着一口青铜古棺，亘古长存。 这是太空探测器在枯寂的宇宙中捕捉到的一幅极其震撼的画面。 九龙拉棺，究竟是回到了上古，还是来到了星空的彼岸？ 一个浩大的仙侠世界，光怪陆离，神秘无尽。热血似火山沸腾，激情若瀚海汹涌，欲望如深渊无止境…… 登天路，踏歌行，弹指遮天。', '002.jpg', '30', );
INSERT INTO books VALUES ('3', '斗罗大陆', '唐家三少', '1', '2011-10-01', '唐门百年难得一见的天才唐三因私学唐门高深内功，被追至悬崖边。他选择以死明志，将绝世暗器佛怒唐莲留下后纵身一跃……意想之中的死亡并没有到来，唐三竟然阴差阳错来到了另一世界，身体也变成了另外一人。这里是斗罗大陆中一个普通的村庄——圣魂村，小小的唐三在这里开始了他的魂师修炼之路，并萌生了振兴唐门的梦想。', '003.jpg', '30', );
INSERT INTO books VALUES ('4', '酒神', '唐家三少', '1', '2010-07-01', '小说讲述国际巅峰调酒大师、品酒大师，有酒神之称的李解冻，为了品尝出土的汉代美酒而醉死于而立之年，却意外来到五行大陆。作为一名阴阳魔师，在这拥有奇异的十系魔技的神奇世界再现酒神辉煌。', '004.jpg', '30', );
INSERT INTO books VALUES ('5', '天珠变', '唐家三少', '1', '2011-10-01', '人有本命珠，觉醒后或为意珠、或为体珠，如手串分别在左右手腕处盘旋。天珠如人类之双胞胎，当意、体双珠同时出现在一个人身上的时候，即为天珠。修炼体珠者是为体珠师，修炼意珠者是为意珠师，而修炼天珠者自然即是天珠师。天珠师最高为十二双珠，因此，它的修炼过程也被称之为：天珠十二变。主角就是一位修炼着天珠变的弓箭手。', '005.jpg', '30', );
INSERT INTO books VALUES ('6', '很纯很暧昧', '鱼人二代', '1', '2013-04-29', '作品讲的是一个高中生杨明意外从街头摆摊的老头手上得到一副神奇透视隐形眼镜的故事，最主要的是，这副眼镜居然能看清别人的想法。多姿多彩的生活一下子降临在了杨明的身上。', '006.jpg', '30', );
INSERT INTO books VALUES ('7', '校花的贴身高手', '鱼人二代', '1', null, '小说讲述了主角林逸奉长辈之命千里迢迢的转学到松山市追求校花，给校花鞍前马后的当跟班，并随手打脸自己的敌人及不断提升实力的故事。', '007.jpg', '30', );
INSERT INTO books VALUES ('8', '斗破苍穹', '天蚕土豆', '1', null, '萧炎，主人公，萧家历史上空前绝后的斗气修炼天才。4岁就开始修炼斗之气，10岁拥有了九段斗之气，11岁突破十段斗之气，一跃成为家族百年来最年轻的斗者。然而在12岁那年，他却“丧失”了修炼能力，只拥有三段斗之气。整整三年时间，家族冷遇，旁人轻视，被未婚妻退婚……种种打击接踵而至。\r\n\r\n就在他即将绝望的时候，一缕灵魂从他手上的戒指里浮现，一扇全新的大门在面前开启！萧炎重新成为家族年轻一辈中的佼佼者，受到众人的仰慕，他却不满足于此。为了一雪退婚带来的耻辱，萧炎来到了魔兽山脉，在药老的帮助下，进一步提升自己的修为……在魔兽山脉，他结识了小医仙。他面向的世界更加宽广了。\r\n\r\n三十年河东，三十年河西，莫欺少年穷！ 年仅15岁的萧家废物，于此地，立下了誓言，从今以后便一步步走向斗气大陆巅峰！\r\n\r\n总算是结束了，末了留了一个另外的悬念，萧炎的血是热的，安静的生活，并不适合他的骨子，留下的悬念，就当为了让他有着征战的理由。', '008.jpg', '30', );
INSERT INTO books VALUES ('9', '大主宰', '天蚕土豆', '1', '2014-01-01', '大千世界，位面交汇，万族林立，群雄荟萃，一位位来自下位面的天之至尊，在这无尽世界，演绎着令人向往的传奇，追求着那主宰之路。 无尽火域，炎帝执掌，万火焚苍穹。 武境之内，武祖之威，震慑乾坤。 西天之殿，百战之皇，战威无可敌。 北荒之丘，万墓之地，不死之主镇天地。 少年自北灵境而出，骑九幽冥雀，闯向了那精彩绝伦的大千世界，主宰之路，谁主沉浮？ 大千世界，万道争锋，吾为大主宰。', '009.jpg', '30', );
INSERT INTO books VALUES ('10', '陶行知文集', '陶行知', '2', '2001-03-01', '陶行知的教育思想是博大而丰富的，本书主要收录的是其与学前教育有关的思想和实践，包括三大部分的内容：理论篇、诗歌篇和实践篇。其中理论篇收录的主要是他的生活教育理论、创造教育理论、幼稚教育理论（包括其教师观、儿童观）。诗歌篇收录了陶行知的与教育有关的儿歌，这些儿歌短小但意蕴深刻。实践篇收录的主要是其学生戴自俺和孙铭勋的相关记述。', '010.jpg', '50', );
INSERT INTO books VALUES ('11', '苏霍姆林斯基选集', '苏霍姆林斯基', '2', '2001-08-01', '人们，尤其是教育界的学者、专家、教师们，在这座纪念碑面前，可以聆听到许许多多脍炙人口的有益教诲；可以汲取到许许多多用来丰富和指导自己工作的理论和经验；在许多方面，它可以作为一面镜子──如何做人的镜子，给人以启迪；在许多方面，它可以作为一部教科书──全面培养人的教科书、素质教育的教科书，给人以借鉴。', '011.jpg', '50', );
INSERT INTO books VALUES ('12', '人力资本的投资', '西奥多·舒尔茨 ', '2', '1982-01-01', '世界上大多数人是贫穷的，所以如果懂得穷人的经济学，我们也就懂得了许多真正重要的经济原理；世界上大多数穷人以农业为生，因而如果我们懂得农业经济学，我们也就懂得许多穷人的经济学。', '012.jpg', '50', );
INSERT INTO books VALUES ('13', '教育与美好生活', '伯特兰·罗素', '2', '2001-01-01', '本书在1931年首先由柳其伟译为中文（名为《罗素教育论》）；后又出版过一个经过删节的中译本；本译本则严格按照原版译出，保持了原书的全貌。为了帮助一般读者理解本书，译者作了一些注解。', '013.jpg', '50', );
INSERT INTO books VALUES ('14', '爱弥儿', '让-雅克·卢梭', '2', '1978-01-01', '讲述了卢梭根据儿童的年龄提出了对不同年龄阶段的儿童进行教育的原则、内容和方法。在第一卷中，着重论述对两岁以前的婴儿如何进行体育教育，使儿童能自然发展。', '014.jpg', '50', );
INSERT INTO books VALUES ('15', '叶圣陶教育文集', '叶圣陶', '2', '1994-01-01', '叶圣陶先生是我国当代卓越的文学家、教育家。他在语文教育方面更有杰出的贡献，被誉为“一代宗师”。他的博大精深的教育思想不仅表述在教育专著和书信里，还体现在他主编的教材和一部分文学作品里。', '015.jpg', '50', );
INSERT INTO books VALUES ('16', '从0到1', '彼得·蒂尔、布莱克·马斯特斯 ', '3', null, '在传统时代，成功企业的商业模式是一个从1到N的过程，也就是在现有基础上，复制之前的经验，通过竞争不断扩大自己的市场影响力。而在互联网时代，成功的企业却是一个从无到有，即从0到1创造市场的过程。 《从0到1》为你开启创新的秘密。PayPal公司创始人、Facebook首位外部投资者彼得·蒂尔在本书中详细阐述了自己的创业历程与心得，包括如何避免竞争、如何进行垄断、如何发现新的市场。《从0到1》还将带你穿越哲学、历史、经济等多元领域，解读世界运行的脉络，分享商业与未来发展的逻辑，帮助你思考从0到1的秘密，在意想不到之处发现价值与机会', '016.jpg', '70', );
INSERT INTO books VALUES ('17', '云攻略', '马克·贝尼奥夫', '3', null, '与谷歌共享同一伟大愿景：云将为产业带来革新·《云攻略》为我们提供了独特的视角，帮助我们了解当今商业领域一个重要趋势的发展。', '017.jpg', '70', );
INSERT INTO books VALUES ('18', '谷歌之道', '\r\n\r\n吉拉尔', '3', null, '《谷歌之道：网络时代的管理创新》作者bernard girard是一位资深的管理专家，在《谷歌之道：网络时代的管理创新》中分析了google领导人创建的商业模式，重点讨论了google创始人采用的管理方法，也对google成长过程中的商业环境进行了深入分析，最后还对google管理模式的瓶颈进行了预测，并对当前全球金融危机对google模式的影响进行了分析。《谷歌之道：网络时代的管理创新》适合对希望研究和借鉴google管理模式，从中得到启示的企业管理者、企业决策顾问阅读，同时也适合对google企业感兴趣的爱好者阅读。', '018.jpg', '70', );
INSERT INTO books VALUES ('19', '未来之路', '比尔·盖茨', '3', null, '《未来之路》与托夫勒的《第三次浪潮》相比，具有更强的实践性与现实性，更有意义的说，比尔·盖茨还以他从容不迫的风度向人们指引了一条通往信息高速公路的途径。章正坤先生在《译后记》中说：“门在英语中叫做GATE。饶有兴味的是，这本《未来之路》的作者比尔·盖茨的英文名字就叫GATES（一道道的门）。所以通过一道道的门，我们就可以进入信息高速公路，从未在未来之路上纵横驰骋，周游八极。”', '019.jpg', '70', );
INSERT INTO books VALUES ('20', '管道的故事', '哈吉斯 ', '4', '2009-03-01', '本书将告诉你，为什么要建造管道以及如何建造管道，让你彻底摆脱“提桶人”的命运，实现真正的财务自由！', '020.jpg', '80', );
INSERT INTO books VALUES ('21', '世界上最伟大的推销员', '奥格·曼狄诺', '4', '2002-08-01', '该书讲述了一个名叫海菲的牧童，从他的主人那里幸运地得到十道神秘的羊皮卷，遵循卷中的原则，他执着创业，最终成为了一名伟大的推销员。', '021.jpg', '80', );
INSERT INTO books VALUES ('22', '厚黑学', '李宗吾', '4', '2011-09-01', '《厚黑学》为民国年间李宗吾先生所作，他在厚黑学一书中，阐述脸皮要厚而无形、心要黑而无色，这样才能成为“英雄豪杰”。他以曹操、刘备、孙权、司马懿等人物实例为主线，探讨论证厚薄与黑白如何影响成败得失。', '022.jpg', '80', );
INSERT INTO books VALUES ('23', '长尾理论', '克里斯·安德森', '4', '2006-12-01', '长尾理论是网络时代兴起的一种新理论，由于成本和效率的因素，当商品储存流通展示的场地和渠道足够宽广，商品生产成本急剧下降以至于个人都可以进行生产，并且商品的销售成本急剧降低时，几乎任何以前看似需求极低的产品，只要有卖，都会有人买。这些需求和销量不高的产品所占据的共同市场份额，可以和主流产品的市场份额相当，甚至更大', '023.jpg', '80', );
INSERT INTO books VALUES ('24', '尚书', '孔子', '5', null, '《尚书》，又称《书》或《书经》，是中国第一部古典文集和最早的历史文献，它以记言为主。自尧舜到夏商周，跨越两千余年。是《三坟五典》的可考记录。\r\n\r\n《尚书》列为儒家经典之一， “尚”即“上”，《尚书》就是上古的书，它是中国上古历史文献和部分追述古代事迹著作的汇编。。', '024.jpg', '100', );
INSERT INTO books VALUES ('25', '周易', '姬昌', '5', null, '《周易》是中国传统思想文化中自然哲学与人文实践的理论根源，是古代汉民族思想、智慧的结晶，被誉为“大道之源”。内容极其丰富，对中国几千年来的政治、经济、文化等各个领域都产生了极其深刻的影响。', '025.jpg', '100', );
INSERT INTO books VALUES ('26', '诗经', '尹吉甫', '5', null, '《诗经》是中国古代诗歌开端，最早的一部诗歌总集。搜集了公元前11世纪至前6世纪的古代诗歌305首，除此之外还有6篇有题目无内容，即有目无辞，称为笙诗六篇（南陔、白华、华黍、由康、崇伍、由仪），反映了西周初期到春秋中叶约五百年间的社会面貌。', '026.jpg', '100', );
INSERT INTO books VALUES ('27', '礼记', '戴圣', '5', null, '《礼记》，西汉戴圣对秦汉以前汉族礼仪著作加以记录，编纂而成，共49篇。“十三经”之一。是战国以后及西汉时期社会的变动，包括社会制度、礼仪制度和人们观念的继承和变化。49篇分属于制度、通论、名堂阴阳、丧服、世子法、祭祀、乐记、吉事等，它阐述的思想，包括社会、政治、伦理、哲学、宗教等各个方面，其中《大学》《中庸》《礼运》等篇有较丰富的汉族哲学思想。', '027.jpg', '100', );
INSERT INTO books VALUES ('28', '春秋', '孔子', '5', null, '《春秋》：即《春秋经》，又称《麟经》或《麟史》，中国古代儒家典籍“六经”[1]  之一。第一部华夏民族编年史兼历史散文集。作为鲁国的编年史，由孔子修订而成。《春秋》成为经书比《诗》、《书》、《礼》、《乐》这四经为晚。李学勤先生强调：“我们不说《易》、《春秋》进入经的时间一定和《诗》、《书》、《礼》、《乐》一样早，可是不会像很多人说的那么晚。因为他们认为《易》、《春秋》之所以进入‘经’，是因为孔子晚年好《易》，他修《春秋》，后来《易》、《春秋》才成为经。', '028.jpg', '100', );

