  `address` varchar(200) NOT NULL COMMENT '地址',
  `photo` mediumblob COMMENT '头像',
  PRIMARY KEY  (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;

